import React from "react";
import "./Components.css";
import img1 from './undraw_developer_activity_bv83.svg'
import Particles from 'react-particles-js'

function Home() {
  return (
    <div className="home" >


<div className="scale-in-center" id="welcome">
                <img src={img1} 
                alt="welcome cats" />
            </div>
      <Particles id="particles-js"
            params={{
                particles: {
                    number: {
                        value: 400,
                        density: {
                            enable: true,
                            value_area: 1000
                        }
                    },
                    color: {
                        value: '#fe4a49'
                    },
                    opacity: {
                        value: 1,
                        anim: {
                            enable: true
                        }
                    },
                    size: {
                        value: 7,
                        random: true,
                        anim: {
                            enable: true,
                            speed: 3
                        }
                    },
                    line_linked: {
                        enable: false
                    },
                    move: {
                        speed: 0.2
                    }
                 }    
            }}    
        />
        </div>
  );
}

export default Home;
